import './UsersRemotePanel.css';
import userPic from '../../images/user.svg';

export default function UsersRemotePanel() {
  return (
    <ul className='usersRemotePanel'>
      <li className='usersRemotePanel__item'>
        <a className='usersRemotePanel__link' href='#'>
          <img className='usersRemotePanel__pic' src={userPic}/>
          {/* <span className='usersRemotePanel__text'>Профиль</span> */}
          Профиль
        </a>
      </li>
    </ul>
  )
}
